CREATE TABLE `club_owner_request` (
  `id` int NOT NULL AUTO_INCREMENT,
  `system_id` varchar(255) NOT NULL,
  `request_id` varchar(255) DEFAULT NULL,
  `name` varchar(255) NOT NULL,
  `gender` varchar(255) DEFAULT NULL,
