  CONSTRAINT `fk_country_id_owner_request` FOREIGN KEY (`country_id`) REFERENCES `country` (`id`),
  CONSTRAINT `fk_request_status_id` FOREIGN KEY (`request_status_id`) REFERENCES `request_status` (`id`),
  CONSTRAINT `fk_request_type_id` FOREIGN KEY (`request_type_id`) REFERENCES `request_type` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=532 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
